CREATE PROCEDURE `addNewReceipt1` (IN `psessionName` VARCHAR(10), IN `pstudentId` INT, IN `preceiptDate` DATE, IN `premark` VARCHAR(256), IN `puserId` VARCHAR(256))  BEGIN
    DECLARE vrno int;
    DECLARE vid  int;
    DECLARE vdate1 varchar(10);
    DECLARE vdate2 varchar(10);
    DECLARE vyear1 int;
    DECLARE vyear2 int;
   
    if Month(preceiptDate) < 4 THEN
    set vyear1 = Year(preceiptDate)-1;
    set vyear2 = Year(preceiptDate);
ELSE
    set vyear1 = Year(preceiptDate);
    set vyear2 = Year(preceiptDate)+1;
end if;
    set vdate1 = concat(vyear1,"-04-01");
    set vdate2 = concat(vyear2,"-03-31");
    set vrno=1;
select max(`rl`.`receiptNo`) into @vrno from (`receiptslist` `rl` join `schoolwisestudents` `ss` on(`rl`.`sessionName` = `ss`.`sessionName` and `rl`.`studentId` = `ss`.`studentId`)) where `rl`.`receiptDate` >=vdate1 and `rl`.`receiptDate` <= vdate2 and schoolId=getSchoolId(pstudentId,psessionName);
END$$

CREATE PROCEDURE `get_datewise_headwise_list` (IN `sdate` VARCHAR(12), IN `edate` VARCHAR(12), IN `p_type` INT, IN `p_school` INT, IN `p_class` VARCHAR(30), IN `p_section` CHAR(1))  SQL SECURITY INVOKER
BEGIN
DECLARE v_finished INTEGER DEFAULT 0;
DECLARE v_head varchar(50) DEFAULT "";
DECLARE v_cond varchar(100) DEFAULT "";
DECLARE v_headlist varchar(10000) DEFAULT "";
DECLARE v_headlist1 varchar(10000) DEFAULT "";
DEClARE headlist_cursor CURSOR FOR 
 SELECT distinct headName from headwisefees1 order by headId ;
 DECLARE CONTINUE HANDLER 
        FOR NOT FOUND SET v_finished = 1;
 open headlist_cursor;
 get_head: LOOP
 
 FETCH headlist_cursor INTO v_head;
 
 IF v_finished = 1 THEN 
 LEAVE get_head;
 END IF;
 
  SET v_headlist = CONCAT(",SUM(IF(`headName`='",v_head,"',`amount`,0)) as '",v_head,"'",v_headlist );
 
 END LOOP get_head;
   
  IF p_type=0 THEN
  	SET v_cond="";
  ELSEIF p_type=1 THEN
  	SET v_cond= CONCAT(" and schoolId=",p_school);
  ELSE 
  	SET v_cond = CONCAT(" and className='",p_class,"' and section='",p_section,"'");
  END IF;

 set v_headlist=concat(v_headlist,",sum(`amount`) as 'Total'");
  CLOSE headlist_cursor;
  set v_headlist1 = CONCAT("select `receiptDate`",v_headlist," from `headwisefees1` where `receiptDate`>='",sdate,"' and receiptDate<='",edate,"'",v_cond,"  group by `receiptDate` ");
  
set @headlist1 = concat(v_headlist1," union select 'Total' as `receiptDate`",v_headlist," from `headwisefees1` where `receiptDate`>='",sdate,"' and receiptDate<='",edate,"'",v_cond," order by `receiptDate` ");

prepare stat1 from @headlist1;
execute stat1;   
  deallocate prepare stat1; 
 END$$

