CREATE FUNCTION `addNewReceipt` (`psessionName` VARCHAR(10), `pstudentId` INT, `preceiptDate` DATE, `premark` VARCHAR(256), `puserId` VARCHAR(256)) RETURNS INT(11) BEGIN
    DECLARE vrno int;
    DECLARE vid  int;
    DECLARE vdate1 varchar(10);
    DECLARE vdate2 varchar(10);
    DECLARE vyear1 int;
    DECLARE vyear2 int;
   
    if Month(preceiptDate) < 4 THEN
    set vyear1 = Year(preceiptDate)-1;
    set vyear2 = Year(preceiptDate);
ELSE
    set vyear1 = Year(preceiptDate);
    set vyear2 = Year(preceiptDate)+1;
end if;
    set vdate1 = concat(vyear1,"-04-01");
    set vdate2 = concat(vyear2,"-03-31");
    set vrno=1;
select  max(`rl`.`receiptNo`) into vrno from (`receiptslist` `rl` join `schoolwisestudents` `ss` on(`rl`.`sessionName` = `ss`.`sessionName` and `rl`.`studentId` = `ss`.`studentId`)) where receiptDate >=vdate1 and receiptDate <= vdate2 and schoolId=getSchoolId(pstudentId,psessionName);
if ISNULL(vrno) then
    set vrno = 1;
     ELSE
      set vrno = vrno + 1;
     end if;
SELECT LAST_INSERT_ID() into vid;
return (vid);
END$$

CREATE FUNCTION `getSchoolId` (`pstudentId` INT, `psessionName` VARCHAR(25)) RETURNS INT(11) BEGIN
    declare vschoolId int;
	select schoolId into vschoolId from `schoolwisestudents` where studentId=pstudentId and sessionName=psessionName;
	return vschoolId;
end$$

