(18, '2020-03-29', 'bctYSOfFnmYkdXSN70njjYMEYxx2', 'Modi seeks \'forgiveness\' from India\'s poor over COVID-19 lockdown', 'Indian Prime Minister Narendra Modi has asked the nation\'s poor for forgiveness, as the economic and human toll from his 21-day nationwide lockdown deepens and criticism mounts over a lack of adequate planning ahead of the decision.\n\n\"I apologise for taking these harsh steps that have caused difficulties in your lives, especially the poor people,\" Modi said in his monthly address on Sunday, broadcast on state radio.', 1, 1, NULL, NULL, 1),
(19, '2020-03-30', 'bctYSOfFnmYkdXSN70njjYMEYxx2', 'Mad Over Parent Meets', 'This is to inform you that we are organizing a parent teacher meet on coming saturday, please do attend and help us build a better and brighter future for you ward. ', 1, 1, NULL, NULL, 1),
